import React ,{useState} from "react";
import { NavLink } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
import {FaUserTie,FaUserCheck,FaTransgenderAlt} from "react-icons/fa";
import {MdEmail,MdCall,MdNumbers} from "react-icons/md";
import {RiLockPasswordFill,RiLockPasswordLine} from "react-icons/ri";
function RegisterPage() {
  // const navigate=useNavigate()
  const [formData,setFormData]=useState({
    firstName:'',lastName:'',age:'',gender:'',phone:'',email:'',password:'',confirm:''

  })
const handleInput=(e)=>{
   const name = e.target.name
   const value= e.target.value
   setFormData({
    ...formData,[name]:value
   })
}
    //  const postData=async(e)=>{
    //   e.preventDefault()
    //   const{ firstName,lastName,age,gender,phone,email,password}=formData
      
    //   const res = await fetch('/register',{
    //     method:'POST',
    //     headers:{'content-Type':'application/json'},
    //     body:JSON.stringify({

    //       firstName,lastName,age,gender,phone,email,password

    //     })
    //   })     
    //   const data = res.json()
    //   if(data.status===422||!data||data.status===404){
    //     window.alert('Data Not Found/bad request')
    //   }else{
    //     navigate('/login')
    //   }
    // }

  return (
   <div className="signup-bg">
    <div className='signup-outer-page'> 
      <div className='signup-inner-page'>
        <form method='POST'>
          <legend id='legend-signup'>Please fill in this form to register</legend>
          <fieldset id='fieldset-signup' >

            <label id='label' for='firstname'><FaUserTie/> First name : </label><br></br>
            <input type='text' id='label-left' name='firstName' value={formData.firstName} onChange={handleInput}  required/><br></br>
             
            <label id='label' for='lastname'><FaUserTie/>Last name : </label><br></br>
            <input type='text' name='lastName' id='label-left' value={formData.lastName} onChange={handleInput} required/><br></br><br></br>

            <label id='label' for='gender'><FaTransgenderAlt/> Gender :</label>
            <select id='label-left' name='gender' value={formData.gender} onChange={handleInput} >
            <option value='male'><FaUserCheck/>Male</option>
            <option value='female'><FaUserCheck/>Female</option>
            <option value='L.G.B.T.Q'><FaUserCheck/>L.G.B.T.Q</option>
            </select ><br></br>

            <label id='label' for='age'><MdNumbers/>Age : </label><br></br>
            <input type='text' id='label-left' value={formData.age} onChange={handleInput} name='age'  required/><br></br>

            <label id='label' for='phone'><MdCall/> Phone :</label><br></br>
            <input type='text' id='label-left' value={formData.phone} onChange={handleInput} name='phone'  required/><br></br>
            
            <label id='label-right' for='email'><MdEmail/> Email :</label> <br></br>
            <input type='email' name='email' id='label-right' value={formData.email} onChange={handleInput}  required/><br></br>

            <label id='label-right' for='password'><RiLockPasswordLine/> Password :</label><br></br>
            <input type='password' name='password' id='label-right' value={formData.password} onChange={handleInput}  required/><br></br> 

            <label id='label-right' for='password'><RiLockPasswordFill/>Confirm Password :</label><br></br>
            <input type='password' name='confirm' id='label-right'  required/><br></br>

            <button className='button-signup' id='label-right'>Sign up</button>
          </fieldset>
        </form>
        <small>Already a user?<NavLink to='/login'>Click here</NavLink></small>
      </div>
    </div>
   </div>
  );
}

export  default RegisterPage;
